import {Table} from "react-bootstrap";

const FileDisplay = (libraryFiles) => {
    return(
              <Table>
        <thead>
          <tr>
            <th>File Name</th>
            <th>File Size</th>
            <th>Date Created</th>
          </tr>
        </thead>
        <tbody>
          {libraryFiles.map((val, index) => {
            return (
              <tr key={index}>
                <td>{val.name}</td>
                <td>{val.size}</td>
                <td>{val.date}</td>
                <td>
                  <input
                    id="defaultUnchecked"
                    type="checkbox"
                    data={val}
                    defaultChecked={false}
                    onChange={() => handleCheck(val, index)}
                  />
                </td>
              </tr>
            );
          })}
        </tbody>
      </Table>
    )
}

export default FileDisplay;
